import React from 'react';
import Header from './Header';

const layoutStyle = {
    width: '640px',
}

function Layout({ children }) {
    return (
        <div
            className="layout"
            style={ layoutStyle }>
            <Header />
            { children }
        </div>
    )
}

export default Layout;
